// src/components/ClientDetail.js
import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

export default function ClientDetail() {
  const { id } = useParams();
  const [cliente, setCliente] = useState(null);

  // Simulamos actividades recientes
  const actividadesSimuladas = [
    { id: 1, titulo: "Llamada telefónica", fecha: "2025-06-20" },
    { id: 2, titulo: "Visita agendada", fecha: "2025-06-18" },
    { id: 3, titulo: "Envío de documentación", fecha: "2025-06-17" },
    { id: 4, titulo: "Primera toma de contacto", fecha: "2025-06-10" },
  ];

  useEffect(() => {
    axios
      .get(`http://localhost:8000/api/clientes/${id}/`)
      .then(res => setCliente(res.data))
      .catch(err => console.error(err));
  }, [id]);

  if (!cliente) return <div>Cargando datos del cliente...</div>;

  return (
    <div className="flex gap-6 w-full">
      {/* Sección principal 2/3 */}
      <div className="w-2/3 space-y-4">
        {/* Rectángulo principal */}
        <div className="bg-white p-6 shadow rounded">
          <h2 className="text-2xl font-bold mb-4">Ficha del Cliente</h2>
          <ul className="space-y-2">
            <li><strong>Nombre:</strong> {cliente.nombre}</li>
            <li><strong>Apellidos:</strong> {cliente.apellido1} {cliente.apellido2 || "—"}</li>
            <li><strong>Trato:</strong> {cliente.trato}</li>
            <li><strong>Sexo:</strong> {cliente.sexo}</li>
            <li><strong>Tipo Documento:</strong> {cliente.tipo_documento}</li>
            <li><strong>Nº Identificación:</strong> {cliente.num_identificacion}</li>
            <li><strong>Dirección:</strong> {cliente.direccion}</li>
            <li><strong>Información Adicional:</strong> {cliente.info_adicional || "—"}</li>
          </ul>
        </div>

        {/* Dos contenedores adicionales (50% cada uno) */}
        <div className="flex gap-4">
          <div className="w-1/2 bg-gray-100 p-4 rounded shadow">
            <h3 className="font-semibold mb-2">Historial</h3>
            <p>Próximamente historial de inmuebles o movimientos...</p>
          </div>
          <div className="w-1/2 bg-gray-100 p-4 rounded shadow">
            <h3 className="font-semibold mb-2">Notas Internas</h3>
            <p>Aquí se podrán añadir anotaciones privadas...</p>
          </div>
        </div>
      </div>

      {/* Sección lateral 1/3 */}
      <div className="w-1/3 space-y-4">
        <h3 className="text-xl font-bold">Actividades recientes</h3>
        {actividadesSimuladas.slice(0, 3).map(actividad => (
          <div key={actividad.id} className="bg-white p-4 shadow rounded">
            <p className="font-semibold">{actividad.titulo}</p>
            <p className="text-sm text-gray-500">{actividad.fecha}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
